<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Gif 1 to SVG Animation</title>

    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      .parentDiv {
        min-height: 100vh;
        display: grid;
        place-items: center;
        background-color: beige;
      }

      .wrapper {
        width: 100%;
      }

      :root {
        --aniDur: 12s;
        --roundingAniDur: calc(var(--aniDur) * 2);
      }

      #potato {
        transform-box: fill-box;
        transform-origin: center;
        animation: rounding var(--roundingAniDur) linear infinite;
      }

      #egg {
        transform-box: fill-box;
        transform-origin: center;
        animation: rounding var(--roundingAniDur) linear infinite reverse;
      }

      @keyframes rounding {
        0% {
          transform: rotate(0deg);
        }

        100% {
          transform: rotate(360deg);
        }
      }

      #arch {
        transform-box: fill-box;
        transform-origin: center;
        animation: upDown var(--aniDur) linear infinite alternate;
      }

      @keyframes upDown {
        100% {
          transform: translateY(-50px);
        }
      }

      #brush-arch {
        transform-box: fill-box;
        transform-origin: center;
        animation: arcUpDown var(--aniDur) linear infinite alternate;
      }

      @keyframes arcUpDown {
        100% {
          transform: translate(-50px, -50px);
        }
      }
    </style>
  </head>
